import styled from '@emotion/styled';

const CarImg = styled.h3`
  padding-top: 24px;
  font-size: 26px;
  line-height: 35px;
  word-break: keep-all;
`;

const CarTitle = styled.h4`
  font-size: 20px;
`;

export const Card = {
  CarImg,
  CarTitle,
};

export default Card;
